INSERT INTO `adminnotification_inbox` VALUES ('1',1,'2017-11-08 00:20:37','Magento Open Source 2.2.1, 2.1.10, and 2.0.17 Enhance Security and Functionality – 11/7/2017','Magento Open Source 2.2.1, 2.1.10, and 2.0.17 include critical security enhancements and functional updates. Review the release notes for more information: \n\nMagento Open Source 2.2.1: \nhttp://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html, \n\nMagento Open Source 2.1.10: \nhttp://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html, \n\nMagento Open Source 2.0.17: \nhttp://devdocs.magento.com/guides/v2.0/release-notes/bk-release-notes.html  \n',' http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,0),('2',4,'2017-11-20 09:04:56','FAQ: How to configure \"read more\" in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\nOnline documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,0),('3',4,'2017-12-12 20:00:41','Magento Open Source 2.2.2 Accelerates Growth with Instant Purchase Checkout, Integrated Email Marketing Automation, Advanced Reporting, and More – 12/12/2017','Our newest release of Magento Open Source equips merchants with powerful tools to accelerate growth and improve operational efficiency. It boosts conversion rates with a streamlined Instant Purchase checkout, jump-starts sales with integrated dotmailer email marketing automation, delivers actionable insights through Advanced Reporting, and provides integrated multi-carrier shipping and fulfillment capabilities with Magento Shipping. https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ','https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ',0,0),('4',4,'2017-12-15 23:19:51','Survey: Do you use site personalization and optimization tools? If yes, we\'d to hear from you!','We\'d like to invite you to take our online survey on site personalization and optimization tools. Your input is valuable and will help to inform the products we bring to market.\n\nThe survey should take no more than 5-7 minutes. \n\nTo get started, go to: \nhttps://www.surveymonkey.com/r/NF9ZH8D\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/NF9ZH8D',0,0),('5',1,'2018-04-09 05:04:15','Take Steps to Protect Your Site ','Our goal is to help you deliver the highest level of security to your Magento site. \n\nYou now have access to a security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. It provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. Please be sure to set your site up for security scanning – activation is quick and easy. Access today in your Magento account.\n\nYou should also visit our Security Center which provides alerts around potential issues as well as best practices to help you protect your site against issues, such as brute force attacks. Brute-force password guessing attacks continue to target Magento Open Source (formerly Community Edition) sites worldwide and we have published an  article that explains multiple actions you can take to protect your site from such attacks. In some cases, these attacks have resulted in unauthorized administrative access, so it is important to implement these recommendations.\n\nTo visit the Magento Security Center:\nwww.magento.com/security\n\nTo view steps you can take to protect against issues like brute force, go to:\nwww.magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks','https://magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks',0,0),('6',1,'2018-06-27 18:45:34','Magento Open Source 2.2.5 delivers important security updates along with performance and functionality enhancements – 6/27/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.5-and-2.1.14-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,0),('7',4,'2018-11-27 20:30:21','Benefit from the Magento Ad Channels Early Access Program','Magento Ad Channels will simplify the set up and administration of Google Merchant Center and Google Ads, while also helping maximize Google Ads ROI to help you accelerate your business growth.\n \nAs an Early Access Program participant, you will gain:\n \n• Exclusive pre-release access to Magento Ad Channels\n• Feedback opportunities to impact features and capabilities\n \nIf you’re a Magento Open Source 2.2.2 or later user, please send an email to sales_channels@magento.com to participate.','https://magento.com/google-smart-shopping-campaigns-in-magento',0,0),('8',1,'2018-11-28 21:03:20','Magento Open Source 2.3.0 delivers Powerful New Merchant and Developer Experience Enhancements – 11/28/2018','The latest release of Magento Commerce includes powerful new tools that enhance both merchant and developer experiences like multi-source inventory management to improve operations and PWA Studio to help create engaging mobile shopping experiences. Magento 2.3 also delivers important security enhancements and performance improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('9',4,'2018-12-18 22:29:42','Take our brief product survey.','We are evaluating adding a media library into the Magento content management system to enable merchants to access their own saved media without re-uploading it each time. This media library may also potentially include third-party stock media with a selection of free and paid media (images, videos, etc.). \n\nTake our survey here:\nhttps://www.surveymonkey.com/r/MWJJWQP\n\nYour survey answers will help us determine the level of interest in these features.','https://www.surveymonkey.com/r/MWJJWQP',0,0),('10',1,'2018-12-25 15:57:51','Attention! You use an ancient version of Blog Extension. It is strongly recommended to update Blog Extension to the newest version 2.8.5',' \n                                https://magefan.com/magento2-blog-extension?ancient=2.6.0                             ','https://magefan.com/magento2-blog-extension?ancient=2.6.0',0,0),('11',4,'2018-12-25 15:57:51','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\n                Online documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,0),('12',4,'2018-12-25 15:57:51','Embed YouTube video with Magento 2 YouTube widget extension by Magefan.','Simple to use, no HTML knowledge required. Includes video lazy load technique for better page speed.','https://magefan.com/magento2-youtube-extension?from=ntf-new',0,0),('13',4,'2019-04-12 01:14:00','Deprecation Notice','Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.','',0,0);
